import React, {Component} from 'react';

class Meal extends Component {
    createTasks(item) {
        return <li key={item.key}>{item.text}</li>
    }

    render() {
        return (
            <div>
                <h2>{this.props.name}</h2>
                <ul>
                    {this.props.ingredients.map((ingredient) => <li key={ingredient}>{ingredient}</li>)}
                </ul>
            </div>

        );
    }
}

export default Meal;
